import React, { useState } from "react";
import styled from "styled-components";
import { CardDeck, Card } from "react-bootstrap";
const Styles = styled.div`
  margin: 1rem;
  flex-basis: 45%;
  padding: 1.5rem;
  text-align: left;
  color: inherit;
  text-decoration: none;
  border: 1px solid #eaeaea;
  border-radius: 10px;
  transition: color 0.15s ease, border-color 0.15s ease;
`;
export const Home = () => {
  return (
    <Styles>
      <CardDeck>
        <Card style={{ width: "18rem" }}>
          <Card.Title>
            <strong>Exterior Estimates</strong>
          </Card.Title>
          <Card.Body>
            <Card.Text>Create Estimate for Exterior Project</Card.Text>
          </Card.Body>
        </Card>
        <Card style={{ width: "18rem" }}>
          <Card.Title>
            <strong>Interior Estimates</strong>
          </Card.Title>
          <Card.Body>
            <Card.Text>Create Estimate for Interior Project</Card.Text>
          </Card.Body>
        </Card>
        <Card style={{ width: "18rem" }}>
          <Card.Title>
            <strong>Exterior Estimates</strong>
          </Card.Title>
          <Card.Body>
            <Card.Text>Create Estmate for Exterior Project</Card.Text>
          </Card.Body>
        </Card>
      </CardDeck>
    </Styles>
  );
};
